import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Peripatetik LLC</h3>
        <p>mid-15c., <a href="https://www.etymonline.com/word/peripatetic"></a><i>Peripatetik,</i> "a disciple of Aristotle, one of the set of philosophers who followed the teachings of Aristotle," from Old French <i>perypatetique</i> (14c.) and directly from Medieval Latin <i>peripateticus</i> "pertaining to the disciples or philosophy of Aristotle," from Greek <i>peripatÄ“tikos</i> "given to walking about" (especially while teaching), from <i>peripatein</i> "walk up and down, walk about," from <i>peri</i> "around, about" (see peri-) + <i>patein</i> "to walk, tread" (see find (v.)). Aristotle's custom was to teach while strolling through the Lyceum in Athens.</p>
      </header>
    </div>
  );
}

export default App;
